"use strict";function swap(r,t,o){var e=r[t];r[t]=r[o],r[o]=e}function bubbleSort(r){if(r.length<=1)return r;for(var t=r.length;2<=t;t--)for(var o=0;o<t-1;o++)r[o]>r[o+1]&&swap(r,o,o+1);return r}function selectSort(r){for(var t=0;t<r.length;t++)for(var o=t+1;o<r.length;o++)r[o]<r[t]&&swap(r,t,o);return r}console.log(bubbleSort([2,5,3,25,15,26,0,8])),console.log(selectSort([2,5,3,25,15,26,0,8]));